export const aboutItems = [
    {
      title: "2020 (14 Years Old)",
      description: "The year of quarantine was the year of me diving into 3d printing. Having stumbled upon a 3d printed boat on TikTok I HAD to learn more. On July 12th I built my Ender 3 Pro. Since then, I've created an entire shelf worth of prints.",
      imageSrc: "assets/shelf.jpg"
    },
    {
      title: "2021-2023 (15-16)",
      description: "I was tasked to spend 25 hours on a project for school and I thought it would be perfect to make a game. Over 500 hours of graphic designing and coding for the first time later: Turtleburg! My edutainment RPG about the water crisis.",
      imageSrc: "assets/turtleburg.jpg"
    },
    {
      title: "2023 (17 Years Old)",
      description: "After Turtleburg, I wanted to dive into other parts of CS. So, I signed up for Kode With Klossy for the summer. I didn't expect to like web development much but ended up coming out with three languages and EdVisor.",
      imageSrc: "assets/kwk.png"
    },
    {
      title: "2023 (17 Years Old)",
      description: "Having finished KWK, I was inspired to do web development on my own. I wanted to start simple, my own website. That in which you are scrolling through right now, Thank You!",
      imageSrc: "assets/cruzcodes.jpg"
    },
    {
      title: "2023 (17 Years Old)",
      description: "I wanted to diversify my summer and did the Girls Who Code SIP for game development. Here I made Cheezy Conundrum and learned alot about p5.js and JavaScript for game development.",
      imageSrc: "assets/cheezy.jpg"
    },
    {
      title: "2023 (17 Years Old)",
      description: "I was inspired by my female in STEM summer that I founded a Girls STEM club at my school. Here I take on the role of teaching coding for our projects. The first project having been the website itself.",
      imageSrc: "assets/gems.PNG"
    },
    {
      title: "To be Determined",
      description: "This is only the beginning, I have a long way to go before I make a real name for myself in computer science. Next steps: Code/Art!",
      imageSrc: "assets/question.jpg"
    }
  ];

